import React, { useState, useEffect } from 'react';
import { motion, AnimatePresence } from 'framer-motion';
import { FiArrowRight, FiMapPin, FiGlobe, FiSun, FiCompass } from 'react-icons/fi';
import './App.css';

const travelDestinations = [
  'Bali, Indonesia',
  'Kyoto, Japan',
  'Santorini, Greece',
  'Maldives',
  'Safari, Kenya',
  'Machu Picchu, Peru',
  'Siem Reap, Cambodia',
  'Rajasthan, India'
];

function App() {
  const [currentDestination, setCurrentDestination] = useState(0);
  const [isVisible, setIsVisible] = useState(true);

  useEffect(() => {
    const timer = setInterval(() => {
      setIsVisible(false);
      setTimeout(() => {
        setCurrentDestination((prev) => (prev + 1) % travelDestinations.length);
        setIsVisible(true);
      }, 500);
    }, 3000);

    return () => clearInterval(timer);
  }, []);

  return (
    <div className="app">
      <nav className="navbar
        ">
        <div className="logo">Navigatio Asia DMC</div>
        <div className="nav-links">
          <a href="#home">Home</a>
          <a href="#destinations">Destinations</a>
          <a href="#about">About Us</a>
          <a href="#contact">Contact</a>
        </div>
      </nav>

      <main>
        <section className="hero" id="home">
          <div className="hero-content">
            <motion.h1 
              initial={{ opacity: 0, y: 20 }}
              animate={{ opacity: 1, y: 0 }}
              transition={{ duration: 0.8 }}
              className="hero-title"
            >
              Discover Asia's Hidden Gems
            </motion.h1>

            <motion.p 
              initial={{ opacity: 0, y: 20 }}
              animate={{ opacity: 1, y: 0 }}
              transition={{ duration: 0.8, delay: 0.2 }}
              className="hero-subtitle"
            >
              Your journey of a lifetime starts here with Navigatio Asia DMC
            </motion.p>

            <AnimatePresence mode="wait">
              <motion.div
                key={currentDestination}
                initial={{ opacity: 0, y: 10 }}
                animate={{ opacity: isVisible ? 1 : 0.5, y: isVisible ? 0 : -10 }}
                exit={{ opacity: 0, y: -10 }}
                transition={{ duration: 0.5 }}
                className="destination-tag"
              >
                <FiMapPin className="icon" />
                <span>{travelDestinations[currentDestination]}</span>
              </motion.div>
            </AnimatePresence>

            <motion.div
              initial={{ opacity: 0, y: 20 }}
              animate={{ opacity: 1, y: 0 }}
              transition={{ duration: 0.8, delay: 0.4 }}
              className="cta-buttons"
            >
              <button className="btn primary">Explore Tours</button>
              <button className="btn secondary">Contact Us</button>
            </motion.div>
          </div>
        </section>

        <section className="features" id="destinations">
          <h2>Why Choose Navigatio Asia DMC?</h2>
          <div className="features-grid">
            <motion.div 
              className="feature-card"
              whileHover={{ y: -10, boxShadow: '0 15px 30px rgba(0,0,0,0.1)' }}
              initial={{ opacity: 0, y: 20 }}
              whileInView={{ opacity: 1, y: 0 }}
              transition={{ duration: 0.5 }}
            >
              <div className="feature-icon">
                <FiGlobe />
              </div>
              <h3>Expert Local Knowledge</h3>
              <p>Our team of local experts ensures authentic experiences that go beyond the typical tourist trails.</p>
            </motion.div>

            <motion.div 
              className="feature-card"
              whileHover={{ y: -10, boxShadow: '0 15px 30px rgba(0,0,0,0.1)' }}
              initial={{ opacity: 0, y: 20 }}
              whileInView={{ opacity: 1, y: 0 }}
              transition={{ duration: 0.5, delay: 0.1 }}
            >
              <div className="feature-icon">
                <FiSun />
              </div>
              <h3>Tailor-Made Itineraries</h3>
              <p>Customized travel plans designed specifically for your interests, pace, and preferences.</p>
            </motion.div>

            <motion.div 
              className="feature-card"
              whileHover={{ y: -10, boxShadow: '0 15px 30px rgba(0,0,0,0.1)' }}
              initial={{ opacity: 0, y: 20 }}
              whileInView={{ opacity: 1, y: 0 }}
              transition={{ duration: 0.5, delay: 0.2 }}
            >
              <div className="feature-icon">
                <FiCompass />
              </div>
              <h3>24/7 Support</h3>
              <p>Round-the-clock assistance throughout your journey for a worry-free experience.</p>
            </motion.div>
          </div>
        </section>
      </main>

      <footer>
        <div className="footer-content">
          <div className="footer-section">
            <h3>Navigatio Asia DMC</h3>
            <p>Creating unforgettable travel experiences across Asia since 2010.</p>
          </div>
          <div className="footer-section">
            <h4>Contact Us</h4>
            <p>Email: info@navigatioasia.com</p>
            <p>Phone: +1 (555) 123-4567</p>
          </div>
          <div className="footer-section">
            <h4>Follow Us</h4>
            <div className="social-links">
              <a href="#">Facebook</a>
              <a href="#">Instagram</a>
              <a href="#">Twitter</a>
            </div>
          </div>
        </div>
        <div className="footer-bottom">
          <p>&copy; {new Date().getFullYear()} Navigatio Asia DMC. All rights reserved.</p>
        </div>
      </footer>
    </div>
  );
}

export default App;
